from fs.errors import ResourceNotFound, FileExists, ResourceError class CephFSOpener(Opener): protocols = ["ceph"] def open_fs(self, fs_url, parse_result, writeable, create, cwd): bucket_name, _, dir_path = parse_result.resource.partition("/") if not bucket_name: raise OpenerError("invalid bucket name in '{}'".format(fs_url)) ceph_fs = CephFS( bucket_name, dir_path=dir_path or "/", ceph_access_key_id=parse_result.username or None, ceph_secret_access_key=parse_result.password or None, endpoint_url=parse_result.params.get("endpoint_url", None), ) return ceph_fs class CephFS(FS): _meta = { "case_insensitive": False, "invalid_path_chars": "\0", "network": True, "read_only": False, "thread_safe": True, "unicode_paths": True, "virtual": False, } def __init__( self, bucket_name, dir_path="/", ceph_access_key_id=None, ceph_secret_access_key=None, endpoint_url=None, ): self._bucket_name = bucket_name self.dir_path = dir_path self._prefix = relpath(normpath(dir_path)).rstrip("/") self.ceph_access_key_id = ceph_access_key_id self.ceph_secret_access_key = ceph_secret_access_key self.endpoint_url = endpoint_url # Endpoint for Ceph's S3 gateway # Initializing boto3 session and resource self.session = boto3.session.Session( aws_access_key_id=self.ceph_access_key_id, aws_secret_access_key=self.ceph_secret_access_key ) self.s3_resource = self.session.resource('s3', endpoint_url=self.endpoint_url) # Ensure we're thread-safe self._lock = threading.RLock() super(CephFS, self).__init__() def _get_bucket(self): return self.s3_resource.Bucket(self._bucket_name) def getinfo(self, path, namespaces=None): with self._lock: try: s3_object = self._get_bucket().Object(path) s3_object.load() # Here you'd map the s3 object details to the expected info structure # This is just a simple example: info = { "name": s3_object.key, "size": s3_object.content_length, "modified": s3_object.last_modified, } return info except Exception as e: raise ResourceNotFound("No resource found at path: {}".format(path)